import React from "react";
import Button from '@material-ui/core/Button';

export default ({ close }) => (
  <div className="modal">
    <a className="close" onClick={close}>
      &times;
    </a>
    <div className="header"> Modal Title </div>
    <div className="content">
      {" "}
        등록할래?
      <Button component = {Link} to ='/Register' size="large" color="secondary" variant="contained"> 예! </Button>
      <Button component = {Link} to ='/Register' style={{height:"200px", width:"200px"}} color="secondary" variant="contained"> 예! </Button>
    </div>
  </div>
);
